// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract SimpleStorage {
    mapping(address => string) private faceHashes;
    address[] private registeredUsers;

    function storeFaceHash(string memory _hash) public {
        require(bytes(_hash).length > 0, "Hash cannot be empty");

        // Only push address if registering for the first time
        if (bytes(faceHashes[msg.sender]).length == 0) {
            registeredUsers.push(msg.sender);
        }

        faceHashes[msg.sender] = _hash;
    }

    function getFaceHash() public view returns (string memory) {
        return faceHashes[msg.sender];
    }

    function getFaceHashOf(address user) public view returns (string memory) {
        return faceHashes[user];
    }

    function getAllUsers() public view returns (address[] memory) {
        return registeredUsers;
    }
}
